    [TestClass]
    public class RetrieveSurescriptsResponseMessageIdOrEmptyTests
    {
        private string _pptPlusResponse = "";

        [TestMethod]
        public void should_return_stringEmpty_if_rxid_does_not_exist()
        {
            //Arrange
            var rxId = Guid.NewGuid();

            var pptPlusContainer = new PptPlusResponseContainer
            {
                ScriptPadMeds = new List<PptPlusScriptPadMed>
                {
                    new PptPlusScriptPadMed
                    {
                        RxId = Guid.NewGuid(),
                        PricingResponse = null
                    }
                }
            };

            //act
            var result = PPTPlus.RetrieveSurescriptsResponseMessageIdOrEmpty(rxId, pptPlusContainer, Guid.Empty, Guid.Empty, ConnectionStringPointer.DEBUG_DB, new Audit());

            //assert
            Assert.AreEqual(string.Empty, result);
        }

        [TestMethod]
        public void should_return_stringEmpty_if_exception_ocurrs()
        {
            //Arrange
            var rxId = Guid.NewGuid();

            var pptPlusContainer = new PptPlusResponseContainer
            {
                ScriptPadMeds = new List<PptPlusScriptPadMed>
                {
                    new PptPlusScriptPadMed
                    {
                        RxId = rxId,
                        PricingResponse = "Not Some JsON BOOM!"
                    }
                }
            };

            var audit = MockRepository.GenerateMock<IAudit>();

            //act
            var result = PPTPlus.RetrieveSurescriptsResponseMessageIdOrEmpty(rxId, pptPlusContainer, Guid.Empty, Guid.Empty, ConnectionStringPointer.DEBUG_DB, audit);

            //assert
            audit.AssertWasCalled(_ => _.AddException(Arg<string>.Is.Anything,
                Arg<string>.Is.Anything,
                Arg<string>.Is.Anything,
                Arg<string>.Is.Anything,
                Arg<string>.Is.Anything,
                Arg<string>.Is.Anything,
                Arg<ConnectionStringPointer>.Is.Anything));

            Assert.AreEqual(String.Empty, result);
        }

